INSERT INTO `Employee` (`Employee ID`, `Supervisor ID`, `Last Name`, `First Name`, `Position`, `Birth Date`, `Hire Date`, `Home Phone`, `Extension`, `Photo`, `Notes`, `Reports To`, `Salary`, `SSN`, `Emergency Contact First Name`, `Emergency Contact Last Name`, `Emergency Contact Relationship`, `Emergency Contact Phone`) VALUES (1,5,"Davolio","Nancy","Sales Representative","1972-12-08 00:00:00","1991-03-29 00:00:00","(206)555-9857","5467","","Education includes a BA in Psychology from Colorado State University in 1994.  She also completed ""The Art of the Cold Call.""  Nancy is a member of Toastmasters International.",2,40000.0000,"913427512","Joseph","Davolio","Brother-In-Law","2065555321");
INSERT INTO `Employee` (`Employee ID`, `Supervisor ID`, `Last Name`, `First Name`, `Position`, `Birth Date`, `Hire Date`, `Home Phone`, `Extension`, `Photo`, `Notes`, `Reports To`, `Salary`, `SSN`, `Emergency Contact First Name`, `Emergency Contact Last Name`, `Emergency Contact Relationship`, `Emergency Contact Phone`) VALUES (2,NULL,"Fuller","Andrew","Vice President, Sales","1969-02-19 00:00:00","1991-07-12 00:00:00","(206)555-9482","3457","","Andrew received his BTS commercial in 1989 and an MBA in International Marketing from the University of Dallas in 1991.  He is fluent in French and Italian and reads German.  He joined the company as a sales representative, was promoted to sales manager in January 1994 and to vice president of sales in March 1996.  Andrew is a member of the Sales Management Roundtable, the Seattle Chamber of Commerce, and the Pacific Rim Importers Association.",NULL,90000.0000,"751513641","Catherine","Mak-Fuller","Wife","2065553656");
INSERT INTO `Employee` (`Employee ID`, `Supervisor ID`, `Last Name`, `First Name`, `Position`, `Birth Date`, `Hire Date`, `Home Phone`, `Extension`, `Photo`, `Notes`, `Reports To`, `Salary`, `SSN`, `Emergency Contact First Name`, `Emergency Contact Last Name`, `Emergency Contact Relationship`, `Emergency Contact Phone`) VALUES (3,5,"Leverling","Janet","Sales Representative","1971-08-30 00:00:00","1991-02-27 00:00:00","(206)555-3412","3355","","Janet has a BS degree in Chemistry from Boston College 1995.  She has also completed a certificate program in Food Retailing Management.  Janet was hired as a sales associate in 1998 and promoted to sales representative in February 1999.",2,33000.0000,"654238712","Jennifer","Hopkins","Sister","2065552996");
INSERT INTO `Employee` (`Employee ID`, `Supervisor ID`, `Last Name`, `First Name`, `Position`, `Birth Date`, `Hire Date`, `Home Phone`, `Extension`, `Photo`, `Notes`, `Reports To`, `Salary`, `SSN`, `Emergency Contact First Name`, `Emergency Contact Last Name`, `Emergency Contact Relationship`, `Emergency Contact Phone`) VALUES (4,5,"Peacock","Margaret","Sales Representative","1973-09-19 00:00:00","1992-03-30 00:00:00","(206)555-8122","5176","","Margaret holds a BA in English literature from Concordia College 1994 and an MA from the American Institute of Culinary Arts 1999.  She was assigned to the London office temporarily from July through November 2000.",2,35000.0000,"646820126","Ed","Anderson","Father","2065551212");
INSERT INTO `Employee` (`Employee ID`, `Supervisor ID`, `Last Name`, `First Name`, `Position`, `Birth Date`, `Hire Date`, `Home Phone`, `Extension`, `Photo`, `Notes`, `Reports To`, `Salary`, `SSN`, `Emergency Contact First Name`, `Emergency Contact Last Name`, `Emergency Contact Relationship`, `Emergency Contact Phone`) VALUES (5,2,"Buchanan","Steven","Sales Manager","1975-03-04 00:00:00","1992-09-13 00:00:00","(715)554-8485","3453","","Steven Buchanan graduated from St. Andrews University, Scotland, with a BSC degree in 1996.  Upon joining the company as a sales representative in 1997, he spent 6 months in an orientation program at the Seattle office and then returned to his permanent post in London.  He was promoted to sales manager in March 1999.  Mr. Buchanan has completed courses in Successful Telemarketing and International Sales Management.  He is fluent in French.",2,50000.0000,"954421324","Kelvin","Buchanan","Son","715556366");
INSERT INTO `Employee` (`Employee ID`, `Supervisor ID`, `Last Name`, `First Name`, `Position`, `Birth Date`, `Hire Date`, `Home Phone`, `Extension`, `Photo`, `Notes`, `Reports To`, `Salary`, `SSN`, `Emergency Contact First Name`, `Emergency Contact Last Name`, `Emergency Contact Relationship`, `Emergency Contact Phone`) VALUES (6,5,"Suyama","Michael","Sales Representative","1963-07-02 00:00:00","1992-09-13 00:00:00","(715)557-7737","428","","Michael is a graduate of Sussex University MA, economics, 1983 and the University of California at Los Angeles MBA, marketing, 1986.  He has also taken courses in Multi-Cultural Selling and Time Management for the Sales Professional.  He is fluent in Japanese and can read and write French, Portuguese, and Spanish.",5,30000.0000,"963126546","James","Lim","Cousin","715557001");
INSERT INTO `Employee` (`Employee ID`, `Supervisor ID`, `Last Name`, `First Name`, `Position`, `Birth Date`, `Hire Date`, `Home Phone`, `Extension`, `Photo`, `Notes`, `Reports To`, `Salary`, `SSN`, `Emergency Contact First Name`, `Emergency Contact Last Name`, `Emergency Contact Relationship`, `Emergency Contact Phone`) VALUES (7,5,"King","Robert","Sales Representative","1972-05-29 00:00:00","1992-11-29 00:00:00","(715)555-5985","465","","Robert King served in the Peace Corps and traveled extensively before completing his degree in English at the University of Michigan in 1997, the year he joined the company.  After completing a course entitled ""Selling in Europe"", he was transferred to the London office in March 1998.",5,37000.0000,"754643213","Kevin","Simmons","Father-In-Law","715555885");
INSERT INTO `Employee` (`Employee ID`, `Supervisor ID`, `Last Name`, `First Name`, `Position`, `Birth Date`, `Hire Date`, `Home Phone`, `Extension`, `Photo`, `Notes`, `Reports To`, `Salary`, `SSN`, `Emergency Contact First Name`, `Emergency Contact Last Name`, `Emergency Contact Relationship`, `Emergency Contact Phone`) VALUES (8,5,"Callahan","Laura","Inside Sales Coordinator","1974-01-09 00:00:00","1993-01-30 00:00:00","(206)555-1189","2344","","Laura received a BA in psychology from the University of Washington.  She has also completed a course in business French.  She reads and writes French.",2,45000.0000,"321264242","Stephen","Callahan","Husband","2065553132");
INSERT INTO `Employee` (`Employee ID`, `Supervisor ID`, `Last Name`, `First Name`, `Position`, `Birth Date`, `Hire Date`, `Home Phone`, `Extension`, `Photo`, `Notes`, `Reports To`, `Salary`, `SSN`, `Emergency Contact First Name`, `Emergency Contact Last Name`, `Emergency Contact Relationship`, `Emergency Contact Phone`) VALUES (9,5,"Dodsworth","Anne","Sales Representative","1976-01-27 00:00:00","1993-10-12 00:00:00","(715)554-4442","452","","Anne has a BA degree in English from St. Lawrence College.  She is fluent in French and German.",5,35000.0000,"422121552","Julie","Roman","Daughter","715552512");
INSERT INTO `Employee` (`Employee ID`, `Supervisor ID`, `Last Name`, `First Name`, `Position`, `Birth Date`, `Hire Date`, `Home Phone`, `Extension`, `Photo`, `Notes`, `Reports To`, `Salary`, `SSN`, `Emergency Contact First Name`, `Emergency Contact Last Name`, `Emergency Contact Relationship`, `Emergency Contact Phone`) VALUES (10,2,"Hellstern","Albert","Business Manager","1968-03-13 00:00:00","1993-03-01 00:00:00","(206)555-4869","7559","","Albert Hellstern is a graduate of Harvard University, where he earned a Bachelor of Science degree in 1991; he also holds a Master's Degree in International Studies from Stanford University 1995.  Mr. Hellstern was hired as Assistant Business Manager in 1993 and was promoted to Business Manager shortly thereafter.  Although Mr. Hellstern is a native speaker of English, he speaks German, French and Spanish with equal fluency.  Mr. Hellstern has travelled extensively in South America and is responsible for establishing our company's presence there.",2,60000.0000,"644564135","Dana","Hellstern","Mother","2065551841");
INSERT INTO `Employee` (`Employee ID`, `Supervisor ID`, `Last Name`, `First Name`, `Position`, `Birth Date`, `Hire Date`, `Home Phone`, `Extension`, `Photo`, `Notes`, `Reports To`, `Salary`, `SSN`, `Emergency Contact First Name`, `Emergency Contact Last Name`, `Emergency Contact Relationship`, `Emergency Contact Phone`) VALUES (11,10,"Smith","Tim","Mail Clerk","1973-06-06 00:00:00","1993-01-15 00:00:00","(206)555-3857","6261","","Tim Smith graduated from Mariner High School and is currently taking evening classes at a local Community College.  He hopes to obtain his AA degree in programming in June 1994 and will then continue his education at the University of Washington in Seattle.  He plans a career as Programmer/Analyst with a local software company.",3,18000.0000,"215554113","Ian","Smith","Brother","2065556465");
INSERT INTO `Employee` (`Employee ID`, `Supervisor ID`, `Last Name`, `First Name`, `Position`, `Birth Date`, `Hire Date`, `Home Phone`, `Extension`, `Photo`, `Notes`, `Reports To`, `Salary`, `SSN`, `Emergency Contact First Name`, `Emergency Contact Last Name`, `Emergency Contact Relationship`, `Emergency Contact Phone`) VALUES (12,10,"Patterson","Caroline","Receptionist","1979-09-11 00:00:00","1993-05-15 00:00:00","(206)555-3480","1411","","Caroline Patterson graduated from Tahoma High School and has an  AA degree from Bellevue Community College in Bellevue, Washington; she is currently participating in the International Trade Series there. She intends to continue her education and expects to earn a  Master's degree in the future.",3,25000.0000,"244122584","Karl","Patterson","Husband","2065556996");
INSERT INTO `Employee` (`Employee ID`, `Supervisor ID`, `Last Name`, `First Name`, `Position`, `Birth Date`, `Hire Date`, `Home Phone`, `Extension`, `Photo`, `Notes`, `Reports To`, `Salary`, `SSN`, `Emergency Contact First Name`, `Emergency Contact Last Name`, `Emergency Contact Relationship`, `Emergency Contact Phone`) VALUES (13,2,"Brid","Justin","Marketing Director","1977-10-08 00:00:00","1994-01-01 00:00:00","(808)383-1662","377","","Justin Brid graduated from HEC Paris Hautes Etudes Commerciales de Paris in 1999 with high honors. Mr. Brid attended the American Graduate School of International Management Thunderbird in Glendale, Arizona.  Prior to his employment with Northwind Traders, he held positions with several  Import/Export companies Culinary Specialties in Germany, Switzerland, and Austria. Mr. Brid is equally fluent in French and German; he also speaks English and reads Spanish.",2,75000.0000,"322412002","Marie","Brid","Mother","88456453");
INSERT INTO `Employee` (`Employee ID`, `Supervisor ID`, `Last Name`, `First Name`, `Position`, `Birth Date`, `Hire Date`, `Home Phone`, `Extension`, `Photo`, `Notes`, `Reports To`, `Salary`, `SSN`, `Emergency Contact First Name`, `Emergency Contact Last Name`, `Emergency Contact Relationship`, `Emergency Contact Phone`) VALUES (14,13,"Martin","Xavier","Marketing Associate","1975-11-30 00:00:00","1994-01-15 00:00:00","(886)243-5389","380","","Xavier Martin is a graduate of the University of Chicago BA and the ESC Bordeaux Ecole Supérieure de Commerce de Bordeaux.  Mr. Martin has travelled widely in Eastern Europe, most recently in the Czech Republic, Poland, and Hungary for purposes of establishing a network of contacts for future sales activities. Mr. Martin is completely fluent in German and French he is a native speaker of both languages; he also speaks English and understands Polish.",13,50000.0000,"640055400","Maxine","Martin","Wife","88456654");
INSERT INTO `Employee` (`Employee ID`, `Supervisor ID`, `Last Name`, `First Name`, `Position`, `Birth Date`, `Hire Date`, `Home Phone`, `Extension`, `Photo`, `Notes`, `Reports To`, `Salary`, `SSN`, `Emergency Contact First Name`, `Emergency Contact Last Name`, `Emergency Contact Relationship`, `Emergency Contact Phone`) VALUES (15,13,"Pereira","Laurent","Advertising Specialist","1970-12-09 00:00:00","1994-02-01 00:00:00","(880)901-6822","376","","Laurent Pereira graduated from  the Ecole Supérieure des Sciences Economiques et Commerciales in 1994.  He plans to continue his studies in 1998 at the University of Bochum.",NULL,45000.0000,"322698901","Jean-Lou","Beauchamps","Cousin","88665262");
