CREATE TABLE `Credit`
 (
	`Credit Authorization Number`			varchar (20), 
	`Customer Credit ID`			int, 
	`Amount`			float
);

CREATE TABLE `Customer`
 (
	`Customer ID`			int, 
	`Customer Credit ID`			int, 
	`Customer Name`			varchar (80), 
	`Contact First Name`			varchar (60), 
	`Contact Last Name`			varchar (60), 
	`Contact Title`			varchar (10), 
	`Contact Position`			varchar (60), 
	`Last Year Sales`			float, 
	`Address1`			varchar (120), 
	`Address2`			varchar (40), 
	`City`			varchar (40), 
	`Region`			varchar (60), 
	`Country`			varchar (60), 
	`Postal Code`			varchar (20), 
	`Email`			varchar (100), 
	`Web Site`			varchar (100), 
	`Phone`			varchar (40), 
	`Fax`			varchar (40)
);

